  true,\n\t\"url\": null,\n\t\"notes\": \"The Baltimore City Department of General
  Services (DGS) administers the Minor Privilege Program, which provides guidelines
  on what can and cannot be placed outdoors within the public right-of-way.nnThe privilege
  can be of a temporary or minor nature, posing little long term impact on the public
  right-of-way and which can be removed with relative ease if desired. Some examples
  include awnings, overhead signs, outdoor seating, sidewalk displays, barber poles,
  permanent dumpsters, etc. A number of minor privileges can be more of a permanent
  nature that may have a long term impact and may not easily be removed such as cornices,
  steps, bay windows, storefronts and vaults.\",\n\t\"license_title\": \"Other License
